import React from 'react';
import { useLocation } from 'react-router-dom';
import MRIForm from '../components/MRIForm';
import { Footer, Navbar } from '../components';
import '../styles/bookform.css';
import services from '../pages/ServicesData'; // Adjust path if needed

const MRIbookTime = () => {
  const location = useLocation();
  const serviceData = location.state?.serviceId; // This is the whole service object

  console.log('Received serviceId:', serviceData); // Debugging line

  // Extract id from the received service object
  const serviceId = serviceData?.id;

  // Check if serviceId is not undefined or null
  if (serviceId == null) {
    console.error('Service ID is missing or invalid');
    return (
      <div>
        <Navbar />
        <div className="book-time-container">
          <h2 className="book-time-text">Service ID is missing or invalid</h2>
        </div>
        <Footer />
      </div>
    );
  }

  // Find the service title based on the serviceId
  const service = services.find(service => service.id === serviceId);
  const serviceTitle = service ? service.title : 'Default Service';

  console.log('Resolved service:', service); // Debugging line
  console.log('Resolved serviceTitle:', serviceTitle); // Debugging line

  return (
    <div>
      <Navbar />
      <div className="book-time-container">
        <h2 className="book-time-text">Din unders√∂kning</h2>
      </div>
      <MRIForm serviceTitle={serviceTitle} />
      <Footer />
    </div>
  );
};

export default MRIbookTime;
